protected void initialize(BatchJob _batchJob)
{

    this.DeepLinkURL =  AAXURLHelper::generateDeepLink( 'BatchJob',
                                    MenuItemType::Display,
                                    formDataSourceStr(BatchJob, BatchJob),
                                    fieldStr(BatchJob,RecId),
                                    _batchJob.RecId);

    next initialize(_batchJob);

}

protected AAXDeepLinkURL parmDeepLinkURL(AAXDeepLinkURL _DeepLinkURL = DeepLinkURL)
{
    DeepLinkURL = _DeepLinkURL;
    return DeepLinkURL;
}
